export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:d,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:d,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:10}}},"140Qv8qX7V":{data:{id:611,attributes:{imdbId:"tt0388419",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTQxMDMxODEwNF5BMl5BanBnXkFtZTYwNzM4OTc2._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"5.4\u002F10"},{Source:"Rotten Tomatoes",Value:"5%"},{Source:"Metacritic",Value:"22\u002F100"}],item_lang:{data:{id:1274,attributes:{title:g,plot:"Strange as it may sound, Luther and Nora Krank, the neighbourhood's award-winning couple for their cheerful Christmas spirit, have decided to skip this year's annual festivities when their daughter, Blair, departs for Peru after joining the Peace Corps. Now, instead of spending the staggering amount of $6,000 on the holiday season, just like the previous year, they are determined to invest the money on a sun-drenched, ten-day Caribbean cruise, much to the chagrin of their friends and neighbours. However, this is easier said than done, and before long, Luther and Nora, who have turned their backs on Christmas, will face the consequences. And then, as if that weren't enough, Blair and her new fiancé announce that they are coming home, utterly unaware that the empty family nest is far from ready for the event. Can the Kranks \"generate\" Christmas out of nothing in less than a few hours?",slug:"christmas-with-the-kranks"}}},books:{data:[{id:4231,attributes:{title:b,description:"Luther and Nora Krank decide to avoid the chaos and frenzy of Christmas by taking a Caribbean cruise during the holidays, but their plans have unexpected consequences.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3IUrAAAAYAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:true,published:"2001-01-01",publisher:"Doubleday Books",subtitle:h}},{id:4232,attributes:{title:b,description:i,thumbnail:j,authors:[c],firstBook:e,published:k,publisher:l,subtitle:m}},{id:4233,attributes:{title:b,description:"Imagine a year without Christmas. No crowded shops, no corny office parties, no fruitcakes, no unwanted presents. That's just what Luther and Nora Krank have in mind when they decide that, just this once, they'll skip the holiday altogether. But, as this weary couple are about to discover, skipping Christmas brings enormous consequences - and isn't half as easy as they'd imagined.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=qAucB0eaTKkC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:e,published:"2011-01-01",publisher:n,subtitle:g}},{id:4234,attributes:{title:b,description:i,thumbnail:j,authors:[c],firstBook:e,published:k,publisher:l,subtitle:m}},{id:4235,attributes:{title:b,description:"Imagine a year without Christmas. No crowded shops, no corny office parties, no fruitcakes, no unwanted presents. That's just what Luther and Nora Krank have in mind when they decide that, just this once, they'll skip the holiday altogether. Theirs will be the only house on the street without a rooftop Frosty the snowman; they won't be hosting their annual Christmas Eve bash; they aren't even going to have a tree. They won't need one, because come December 25 they're setting sail on a Caribbean cruise. But, as this weary couple is about to discover, skipping Christmas brings enormous consequences - and isn't half as easy as they'd imagined. A classic tale for modern times, Skipping Christmas offers a hilarious look at the chaos and frenzy that has become part of our holiday tradition.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Nfot8DgmADMC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c,"John"],firstBook:e,published:"2011-11-03",publisher:n,subtitle:h}}]}}},meta:{}}},prerenderedAt:1688531305746}}("movie","Skipping Christmas","John Grisham","series",null,1,"Christmas with the Kranks","","#1 NEW YORK TIMES BESTSELLER • Imagine a year without Christmas. No crowded malls, no corny office parties, no fruitcakes, no unwanted presents. That’s just what Luther and Nora Krank have in mind when they decide that, just this once, they’ll skip the holiday altogether. Theirs will be the only house on Hemlock Street without a rooftop Frosty, they won’t be hosting their annual Christmas Eve bash, they aren’t even going to have a tree. They won’t need one, because come December 25 they’re setting sail on a Caribbean cruise. But as this weary couple is about to discover, skipping Christmas brings enormous consequences—and isn’t half as easy as they’d imagined. A classic tale for modern times from a beloved storyteller, John Grisham’s Skipping Christmas offers a hilarious look at the chaos and frenzy that have become part of our holiday tradition.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wFVpT3msHPQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2010-03-16","Anchor","A Novel","Random House"))